$(document).ready(function(){$("#btnCpfListView").button().bind("click",viewCpfList);$("#btnCpfListPrint").button().bind("click",printCpfList);$("#btnCpfListExport").button().bind("click",exportCpfList);$("#cobCpfListMonth").val(new Date().getMonth()+1);$("#cobCpfListYear").val(new Date().getFullYear());$("#cobCpfListMonth").focus();$(window).resize(resizeCpfListGrid);resizeCpfListGrid()});function resizeCpfListGrid(){var a=$("#sbg-center-panel").outerHeight()-$("#sbg-cpflist-option").outerHeight()-70;$("div#sbg-cpflist-data").css("height",a+"px")}function exportCpfList(){if(validateCpfList()){var a="report.pzx?c="+cpflist_url+"&d="+new Date().getTime()+"&t="+C_EXPORT+"&co="+$("#cobCpfListCoy").val()+"&m="+$("#cobCpfListMonth").val()+"&y="+$("#cobCpfListYear").val();showReport(a)}}function printCpfList(){var b={type:C_REPORT,co:$("#cobCpfListCoy").val(),m:$("#cobCpfListMonth").val(),y:$("#cobCpfListYear").val()};var a="report.pzx?c="+cpflist_url+"&d="+new Date().getTime()+"&t="+C_REPORT+"&co="+$("#cobCpfListCoy").val()+"&m="+$("#cobCpfListMonth").val()+"&y="+$("#cobCpfListYear").val();showReport(a)}function viewCpfList(){var b={type:C_LIST,coy:$("#cobCpfListCoy").val(),month:$("#cobCpfListMonth").val(),year:$("#cobCpfListYear").val()};var a="request.pzx?c="+cpflist_url+"&d="+new Date().getTime();callServer(a,"html",b,showCpfList)}function validateCpfList(){if($("#cobCpfListCoy").blank()){alert("You must select a Company for the Export.");$("#cobCpfListCoy").focus();return false}return true}function showCpfList(b,c){var a='<tr><td style="width:50px;height:1px"></td><td style="width:150px"></td><td style="width:200px"></td><td style="width:150px"></td><td style="width:80px"></td><td style="width:80px"></td><td style="width:80px"></td><td style="width:80px"></td><td style="width:80px"></td></tr>';$("#sbg-cpflist-table").html(a+c)};